import React from "react";
import styled from 'styled-components';

const Star = styled.div`
  display: inline-block;
  position: absolute;
  font-size: 32.5px;
  top: 6px;
`

const Wrapper = styled.div`
  position: relative;
  margin: 50px 125.5px 0 125.5px;
  padding: 0 30px;
  h1 {
    line-height: 1.07;
  }
`
const Description = styled.div`
    font-size: 14px;
    line-height: normal;
    letter-spacing: 0;
    color: #202d3d;
    margin-top: 15px;
    font-weight: 400;
`

export const About = () => {
    return (<Wrapper>
        <h1>
            Мобильный <span>ID<Star>*</Star></span>
        </h1>
        <Description>* Услуга предоставляется для юридических лиц.</Description>

    </Wrapper>)
}
